import axios from "axios";

export default class List extends React.Component {

state = {
  ssds: []
 }
// state = {
//   categories: []
// }

componentDidMount(){
  axios.get('http://localhost:9090/ssd/list').then(res => {
    const ssds = res.data;
    this.setState({ ssds });

    // const categories = res.data;
    // this.setCategories ({ categories});
  })
}
render(){
  return (
    <ul>
      {this.state.ssds.map((ssd) => (
        <li>
          <label></label>
          <li key={ssd.id}>{ssd.id}</li>
         {ssd.brand} / {ssd.model}
          <li >{ssd.size}</li>
          <li >{ssd.purchasePrice}</li>
          <li >{ssd.purchaseDate}</li>
          <li >{ssd.arrivalDate}</li>
          <li >{ssd.saleValue}</li>
          <li >{ssd.url}</li>
          ------------- CATEGORIA AQUI -------------------
          <li key={ssd.id}>{ssd.productCategory}</li>
        </li>
      ))}
